import React from 'react';

function CategoryNavigation() {
    return (
        <ul>
            <li key="all">전체</li>
            <li key="food">음식</li>
            <li key="clothes">의류</li>
            <li key="convenience">생활편의</li>
        </ul>
    );
}

export default CategoryNavigation;
